        "I fangirl you so hard! You are fearless, dynamic and totally unguardable! You are also joyful, thoughtful and kind. It is a privilege to be your teammate.  ~ Maddie",
        "I feel very privileged to be on this campaign with you and hope to get to know you better over the coming months. \n\nYou're determination and competitiveness make you an exciting player to watch, and your cheeky nature makes you a pleasure to be around. \n\nLet's go and win Worlds! ðŸš€  ~ Coach Bree",
