        "Looking forward to properly meeting you and playing with you ðŸ˜ŽðŸ˜Ž ~ Dot",
        "A total dominator on the field - both on O & D! Such a smart player and a huge asset for this team. Also a wonderful person and team mate! Canâ€™t wait to watch you tear it up at WUC ðŸ”¥ ~ Ynez",
